window.bookSummaryJSON = "<p>Carl Logan was the perfect agent. A loner with no real friends or family, he was trained to deal with any situation with cold efficiency, devoid of emotion. But Logan isn't the man he used to be or the asset he once was. </p> <p>Five months ago his life changed forever when he was captured, tortured and left for dead by Youssef Selim, one of the world's most violent terrorists. When Selim mysteriously reappears in Paris, linked to the kidnapping of America's attorney general, Logan smells his chance for revenge. </p> <p>Pursuing his man relentlessly, oblivious to the growing trail of destruction that he leaves in his wake, Logan delves increasingly deep into the web of lies and deceit surrounding the kidnapping. Finally, he comes to learn just what it means to dance with the enemy. </p>"; 
